  true,\n\t\"url\": null,\n\t\"notes\": \"A list of individuals and entities that
  have been denied export privileges. Any dealings with a party on this list that
  would violate the terms of its denial order is prohibited. This list is not meant
  to stand alone.  It should be used in combination with the Export Administration
  Regulations including the Unverified List (BIS), Entity List (GPO), Specially Designated
  Nationals List (Treasury), Debarred List (State) and Nonproliferation Sanctions
  List (State).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
